import { useEffect, useState } from 'react'
import "./Details.css"

export const GalleryView = () => { 

    const [photos, setPhotos] = useState([])

    useEffect( 
        () => { 
            fetch(`http://localhost:8088/gallery`)
                .then(response => response.json())
                .then((photoGallery) => 
                    setPhotos(photoGallery))
        }, 
        []
    )
    return (
        <>
        <h3>Gallery</h3>
        </>
    )
}
